// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title LendingPool.
 * @author RapidLoans.
 * @notice A lending pool for Rapidloans to issue flash loans from.
 * @dev Token pair used currently is TRX/JST.
 */
contract LiquidityPool {
    IERC20 public jstToken;
    uint256 public trxFlashLoanFee; // Fee for flash loans in TRX (in wei)
    uint256 public jstFlashLoanFee; // Fee for flash loans in JST (in smallest unit)

    struct Investor {
        address investorAddress;
        uint256 balanceTRX;
        uint256 balanceJST;
    }

    Investor[] internal investors;
    mapping(address => uint256) internal investorIndexes;

    error LendingPool__InvalidAmount();
    error LendingPool__InsufficientBalance();
    error LendingPool__InvalidWithdrawAmount();
    error LendingPool__RepaymentFailed();

    constructor(address _jstTokenAddress, uint256 _trxFlashLoanFee, uint256 _jstFlashLoanFee) {
        jstToken = IERC20(_jstTokenAddress);
        trxFlashLoanFee = _trxFlashLoanFee;
        jstFlashLoanFee = _jstFlashLoanFee;

        Investor memory initialInvestor = Investor({
            investorAddress: address(0),
            balanceTRX: 0,
            balanceJST: 0
        });
        investors.push(initialInvestor);
        investorIndexes[address(0)] = 0;
    }

    /**
     * @notice Add TRX to the liquidity pool.
     */
    function addTRX() external payable {
        require(msg.sender != address(0), "Invalid sender address");
        require(msg.value > 0, "Amount must be greater than 0");

        if (investorIndexes[msg.sender] == 0) {
            Investor memory newInvestor = Investor({
                investorAddress: msg.sender,
                balanceTRX: msg.value,
                balanceJST: 0
            });
            investors.push(newInvestor);
            investorIndexes[msg.sender] = investors.length - 1;
        } else {
            investors[investorIndexes[msg.sender]].balanceTRX += msg.value;
        }
    }

    /**
     * @notice Add JST to the liquidity pool.
     */
    function addJST(uint256 amount) external {
        require(msg.sender != address(0), "Invalid sender address");
        require(amount > 0, "Amount must be greater than 0");

        bool success = jstToken.transferFrom(msg.sender, address(this), amount);
        require(success, "Token transfer failed");

        if (investorIndexes[msg.sender] == 0) {
            Investor memory newInvestor = Investor({
                investorAddress: msg.sender,
                balanceTRX: 0,
                balanceJST: amount
            });
            investors.push(newInvestor);
            investorIndexes[msg.sender] = investors.length - 1;
        } else {
            investors[investorIndexes[msg.sender]].balanceJST += amount;
        }
    }

    /**
     * @notice Perform a flash loan with TRX.
     * @param amount The amount of TRX to loan.
     */
    function flashLoanTRX(uint256 amount) external payable {
        uint256 initialBalance = address(this).balance;
        require(amount > 0 && amount <= initialBalance, "Invalid loan amount");

        // The fee for taking a TRX flash loan
        uint256 fee = (amount * trxFlashLoanFee) / 10000; 
        payable(msg.sender).transfer(amount);


        (bool success,) = msg.sender.call{value: 0}("");
        require(success, "Execution failed");

        // Check that the borrower repaid the loan + fee
        require(address(this).balance >= initialBalance + fee, "Repayment failed");
    }

    /**
     * @notice Perform a flash loan with JST.
     * @param amount The amount of JST to loan.
     */
    function flashLoanJST(uint256 amount) external payable {
        uint256 initialBalance = jstToken.balanceOf(address(this));
        require(amount > 0 && amount <= initialBalance, "Invalid loan amount");


        uint256 fee = (amount * jstFlashLoanFee) / 10000; // Fee as percentage basis points

        // Send JST to the borrower
        bool sent = jstToken.transfer(msg.sender, amount);
        require(sent, "Transfer failed");

        // Execute borrower's logic (borrower's contract should implement this logic)
        (bool success,) = msg.sender.call{value: 0}("");
        require(success, "Execution failed");

        // Ensure repayment + fee
        uint256 finalBalance = jstToken.balanceOf(address(this));
        require(finalBalance >= initialBalance + fee, "Repayment failed");
    }

    /**
     * @notice Withdraw TRX from the liquidity pool.
     */
    function withdrawTRX(uint256 amount) external {
        require(investorIndexes[msg.sender] != 0, "Investor not found");
        uint256 investorIndex = investorIndexes[msg.sender];
        uint256 availableTRX = investors[investorIndex].balanceTRX;

        if (amount > availableTRX) {
            revert LendingPool__InsufficientBalance();
        }

        investors[investorIndex].balanceTRX -= amount;
        payable(msg.sender).transfer(amount);
    }

    /**
     * @notice Withdraw JST from the liquidity pool.
     */
    function withdrawJST(uint256 amount) external {
        require(investorIndexes[msg.sender] != 0, "Investor not found");
        uint256 investorIndex = investorIndexes[msg.sender];
        uint256 availableJST = investors[investorIndex].balanceJST;

        if (amount > availableJST) {
            revert LendingPool__InsufficientBalance();
        }

        investors[investorIndex].balanceJST -= amount;
        bool success = jstToken.transfer(msg.sender, amount);
        require(success, "Token transfer failed");
    }

    /**
     * @notice Retrieve investor data.
     */
    function getInvestorData() public view returns (Investor memory) {
        return investors[investorIndexes[msg.sender]];
    }
}

